  - name: TEXT4000
    number: '6'
    value: Administrative expenses do not include rent payments because the North
      Carolina Republican Party owns the building located at 1506 Hillsborough Street,
      Raleigh, NC from where our business is conducted.  Our Best efforts procedure
      for obtaining employer and occupation information complies with the Federal
      Election Commissions regulations.  Our original solicitation requests the contributors
      name, address, employer and occupation and states that this request is a requirement
      of federal law.  If we dont obtain the information, we send a letter within
      30 days requesting the employer and occupation information.  When the requested
      information is received, it is entered into the contributors record and noted
      on the next months FEC report. Utility payments such as City of Raleigh, Duke
      Energy and Time Warner Cable are no longer an allocated expense because a new
      state law effective January 1, 2014 was passed to allow utilities to be paid
      out of our Building Fund account.  The postage for the Business Reply Mail account
      is the cost of self-addressed stamped envelopes that were mailed with the direct
      mail and telemarketing solicitations. The expenditures to Neopost were for postage
      on the postage meter which is used in the office. The expenditures for Generic
      Donor/Prospect Direct Mail and Generic Telemarketing Donors were solicitations
      of contributions for party fundraising. The Food for NCGOP Fundraising Event
      and Print NCGOP Fundraising Invitations were costs associated with Party building
      fundraising events and were not made on behalf of any specifically identified
      federal candidate. The mileage and travel expense reimbursements were reimbursements
      to staff members for travel throughout the state. Some of the amounts reimbursed
      to staff members do not print on the FEC report because the vendors are below
      the $200 per year itemization level.
